import React, { PureComponent } from 'react';
import "./right.css";
import EyeIcon from "../Image/eyeIcon.png";
export default class ExpertsManagement extends PureComponent {
    constructor(props) {
        super(props);
        this.state = { 
		names: [],
		looks:[],
		}
    }

    render(){
		let name = this.state.names;
		let look = this.state.looks;
		for(let i=0;i<99;i++){
			look.push(<img src={EyeIcon} alt=""/>);
			name.push("XXX名称"+i);
		}
		this.setState({
			looks: look,
			names: name
        });
        return (
		<div>
           <div >{this.state.looks}</div>
		    <div >{this.state.names}</div>
			</div>
        )
    }
}
